import { useState } from "react";

function Card() {

    let [nutrients, setNutrients] = useState(['Omega-3', 'multivitimin'])

    return (
        <>
            <section class="text-gray-600">
                {
                    nutrients.map((data, i) => {
                        return (
                            <div class="container px-5 py-10 mx-auto">
                                <div class="flex flex-wrap -m-4">
                                    <div class="p-4 md:w-1/3">
                                        <div class="flex rounded-lg h-full bg-gray-100 p-8 flex-col">
                                            <div class="flex items-center mb-3">
                                                <h2 class="text-gray-900 text-lg font-medium">{data}</h2>
                                                <p class=" text-indigo-500 ml-2 text-sm">시간</p>
                                            </div>
                                            <div class="flex-grow text-gray-600">
                                                <p class="text-base">Blue bottle crucifix vinyl post-ironic four dollar toast vegan taxidermy. Gastropub indxgo juice poutine.</p>
                                                <p className='mt-1'>남은 알약 수</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        )
                    })
                }
            </section>
        </>
    )
}

export default Card;
